import React from 'react'
import './App.css'

function displayOneSubsection(subsection) {
	return (
		<div>
			<h5> <b>{subsection.number}</b></h5>
			<h6> <b>Location</b>: {subsection.location}</h6> 
			<h6> <b>Meeting Time</b>: {getMeetingTime(subsection.time)}</h6> 
		</div>
	)
}

function getMeetingTime(time) {
	var size = Object.keys(time).length;
	if (size == 0) {
		return "None";
	}
	return (
		<div>
			{Object.keys(time).map((weekday) => (
				<h6> {weekday}: {time[weekday]}</h6>
			))}
		</div>
	);
}

class Subsection extends React.Component {

	constructor(props) {
		super(props);
		this.state = {
			data: props.data,
		}
	}

	render() {
		console.log(this.state.data)
		return (
			<div>
				{this.data.map(subsection => (
					displayOneSubsection(subsection)
				))}
			</div>
		)
	}
}

export default Subsection;
